import styled from 'styled-components'


export const Layout = styled.div`
    display:flex;
    justify-content: center;
    align-items:center;
`

export const CardLayout = styled.div`
    display:flex;
    flex-direction:row;
    margin: 35px;
`;

export const ScoreLayout = styled.div`
    display:flex;
    flex-direction:column;
    margin: 16px;
